@Quế Sơn
- (huyện) Huyện thuộc tỉnh Quảng Nam. Diện tích 737km2. Số dân 123.600 (1997). Địa hình núi thấp, có đỉnh núi Tàu (952m), đồng bằng do thung lũng các sông nhỏ hẹp. Sông Thu Bồn, Bà Rén chảy qua. Khoáng sản: than Nông Sơn, cao lanh Đèo Le, than bùn Quế Phú. Quốc lộ 1, 14B, đường sắt Thống Nhất chạy qua. Huyện trước đây thuộc tỉnh Quảng Nam, thuộc tỉnh Quảng Nam-Đà Nẵng (1976-96), từ 6-11-1996 trở lại tỉnh Quảng Nam, gồm 1 thị trấn (Đông Phú) huyện lị, 16 xã
- (xã) h. Sơn Động, t. Bắc Giang

@Quế Phong
- (huyện) Huyện ở cực bắc tỉnh Nghệ An. Diện tích 1857km2. Số dân 55.200 (1997), gồm các dân tộc: Kinh, Thổ, Khơ Mú, H'mông. Địa hình phần lớn là núi thấp, xen đồi thấp, các đỉnh núi: Phu Hoạt (2452m), Bù Hàm (1119m). Sông Chu, Ngòi Quang chảy qua. Đất rừng chiếm 70% diện tích, chủ yếu đất latenit núi đỏ vàng. Đường 532 chạy qua. Từ xưa huyện thuộc tỉnh Nghệ An, thuộc tỉnh Nghệ Tĩnh (1975-91), từ 20-7-1991 trở lại tỉnh Nghệ An, gồm 1 thị trấn (Kim Sơn) huyện lị, 12 xã
- (xã) h. Quế Sơn, t. Quảng Nam

